[{"location":"","page":"Home","title":"Home","text":"CurrentModule = SchottkyAnoMaLy","category":"page"},{"location":"#SchottkyAnoMaLy","page":"Home","title":"SchottkyAnoMaLy","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for SchottkyAnoMaLy.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [SchottkyAnoMaLy]","category":"page"},{"location":"#SchottkyAnoMaLy.DonutVolcanoEnsemble","page":"Home","title":"SchottkyAnoMaLy.DonutVolcanoEnsemble","text":"DonutVolcanoEnsemble{T <: Real}\n\nAn ensemble of M donutvolcanos takes the form \n\nmathrmp_M(x) = frac1M sum_k=1^M mathrmdonutvolcano(x mu_k sigma_k)\n\nThis object is a wrapper around an ensemble::Vector{Tuple{T, T}} for the individual donutvolcanos. The values of (μ_k σ_k) are restricted such that mu_k geq 0 and sigma_k  0 via the valid function.\n\n\n\n\n\n","category":"type"},{"location":"#SchottkyAnoMaLy.DonutVolcanoEnsemble-Tuple{Any}","page":"Home","title":"SchottkyAnoMaLy.DonutVolcanoEnsemble","text":"(::DonutVolcanoEnsemble)(x)\n\nEvaluate the DonutVolcanoEnsemble as a function over a set of values x.\n\njulia> dve = DonutVolcanoEnsemble(Float64, [(0, 1)]);\n\njulia> dve(2)\n0.2706705664732254\n\njulia> dve([3, 4])\n2-element Vector{Float64}:\n 0.033326989614726917\n 0.0013418505116100474\n\n\n\n\n\n","category":"method"},{"location":"#SchottkyAnoMaLy.DonutVolcanoEnsemble-Union{Tuple{Array{Tuple{T, T}, 1}}, Tuple{T}} where T","page":"Home","title":"SchottkyAnoMaLy.DonutVolcanoEnsemble","text":"DonutVolcanoEnsemble(args...)\n\nVarious interfaces to a DonutVolcanoEnsemble\n\nCopy/Move constructors\n\nDonutVolcanoEnsemble(::Vector{Tuple{T, T}})\nCreate an ensemble from a Vector of (μ, σ) Tuples of the same Type.\nDonutVolcanoEnsemble(::Vector{Tuple{T, U}})\nCreate an ensemble from a Vector of (μ, σ) Tuples of the different Types. \nThe type of the ensemble is chosen by Base.promote_type.\nDonutVolcanoEnsemble(::Type{S}, ::Vector{Tuple{T, U}})\nCreate an ensemble from a Vector of (μ, σ) Tuples of the different Types into an ensemble of with preferred type S.\nThe ultimate type of the ensemble is chosen by Base.promote_type.\n\nnote: Note\nThe constructors above will check that any supplied pair is valid.\n\nEmpty constructors\n\nDonutVolcanoEnsemble(::Type{S})\nCreate an empty ensemble of chosen type S.\nDonutVolcanoEnsemble()\nCreate an empty ensemble. By default the type is Float64.\n\n\n\n\n\n","category":"method"},{"location":"#Base.append!-Union{Tuple{T}, Tuple{DonutVolcanoEnsemble{T}, Any}} where T","page":"Home","title":"Base.append!","text":"Base.append!(::DonutVolcanoEnsemble, vals)\n\nAppend the vals::Vector{Tuple{S, T}} to the DonutVolcanoEnsemble.\n\njulia> dve = DonutVolcanoEnsemble()\nDonutVolcanoEnsemble{Float64}(Tuple{Float64, Float64}[])\n\njulia> append!(dve, [(0, 1), (1, 3)])\n2-element Vector{Tuple{Float64, Float64}}:\n (0.0, 1.0)\n (1.0, 3.0)\n\njulia> dve\nDonutVolcanoEnsemble{Float64}([(0.0, 1.0), (1.0, 3.0)])\n\nnote: Note\nThis function will check that the pair is valid.\n\n\n\n\n\n","category":"method"},{"location":"#Base.eltype-Union{Tuple{DonutVolcanoEnsemble{T}}, Tuple{T}} where T","page":"Home","title":"Base.eltype","text":"Base.eltype(::DonutVolcanoEnsemble)\n\nReturn the type of the DonutVolcanoEnsemble.\n\njulia> dve = DonutVolcanoEnsemble()\nDonutVolcanoEnsemble{Float64}(Tuple{Float64, Float64}[])\n\njulia> eltype(dve)\nFloat64\n\n\n\n\n\n","category":"method"},{"location":"#Base.push!-Union{Tuple{T}, Tuple{DonutVolcanoEnsemble{T}, Any}} where T","page":"Home","title":"Base.push!","text":"Base.push!(::DonutVolcanoEnsemble, pair)\n\nPush a new (μ, σ) Tuple into a given DonutVolcanoEnsemble.\n\njulia> dve = DonutVolcanoEnsemble()\nDonutVolcanoEnsemble{Float64}(Tuple{Float64, Float64}[])\n\njulia> push!(dve, (0, 1))\n1-element Vector{Tuple{Float64, Float64}}:\n (0.0, 1.0)\n\njulia> dve\nDonutVolcanoEnsemble{Float64}([(0.0, 1.0)])\n\nnote: Note\nThis function will check that the pair is valid.\n\n\n\n\n\n","category":"method"},{"location":"#SchottkyAnoMaLy.Theta-Tuple{Any}","page":"Home","title":"SchottkyAnoMaLy.Theta","text":"Theta(x)\n\nPackage-specific implementation of the Heaviside Theta function. Our definition is\n\nTheta(x) = begincases\n1  x geq 0\n\n0  mathrmotherwise\nendcases\n\n\n\n\n\n","category":"method"},{"location":"#SchottkyAnoMaLy.donutvolcano-Tuple{Any, Any, Any}","page":"Home","title":"SchottkyAnoMaLy.donutvolcano","text":"donutvolcano(x, μ, σ)\n\nThe donutvolcano distribution calculated for an input x with center μ and width σ. The argument x can be a scalar or broadcastable.\n\nThe distribution itself is given by \n\nrm donutvolcano(x μ σ) = fracx Theta(x)mathcalN(musigma) expleft -fracleft(x - muright)^22sigma^2 right\n\nwhere we use our own Heaviside Theta function above. The normalization constant mathcalN(musigma) given by norm_donutvolcano.\n\n\n\n\n\n","category":"method"},{"location":"#SchottkyAnoMaLy.ensemble-Tuple{DonutVolcanoEnsemble}","page":"Home","title":"SchottkyAnoMaLy.ensemble","text":"ensemble(::DonutVolcanoEnsemble)\n\nGetter for the Vector{Tuple{T, T}} of the given ensemble.\n\n\n\n\n\n","category":"method"},{"location":"#SchottkyAnoMaLy.get_pair-Tuple{DonutVolcanoEnsemble, Any}","page":"Home","title":"SchottkyAnoMaLy.get_pair","text":"get_pair(::DonutVolcanoEnsemble, pair_idx) -> Tuple{T, T}\n\nGetter for a single pair (Tuple{T, T}) at a specified pair_idx.\n\n\n\n\n\n","category":"method"},{"location":"#SchottkyAnoMaLy.norm_donutvolcano-Tuple{Any, Any}","page":"Home","title":"SchottkyAnoMaLy.norm_donutvolcano","text":"norm_donutvolcano(μ, σ)\n\nThe normalization for a donutvolcano distribution with center μ and width σ. The explicit form is given by\n\nmathcalN(mu sigma) = sqrtfracpi 2 mu  sigma \n   lefttexterfleft(fracmu sqrt2 sigma\nright)+1right+sigma ^2 rm e^-fracmu ^22 sigma ^2\n\n\n\n\n\n","category":"method"},{"location":"#SchottkyAnoMaLy.npairs-Tuple{DonutVolcanoEnsemble}","page":"Home","title":"SchottkyAnoMaLy.npairs","text":"npairs(::DonutVolcanoEnsemble)\n\nReturn the number of donutvolcano in the DonutVolcanoEnsemble.\n\n\n\n\n\n","category":"method"},{"location":"#SchottkyAnoMaLy.valid-Tuple{Any}","page":"Home","title":"SchottkyAnoMaLy.valid","text":"valid(::Tuple{T, T})\n\nReturns the given Tuple (μ, σ) if μ ≥ 0 and σ > 0. Otherwise, an AssertionError  will be thrown.\n\n\n\n\n\n","category":"method"},{"location":"#SchottkyAnoMaLy.μvalue-Union{Tuple{Tuple{T, T}}, Tuple{T}} where T","page":"Home","title":"SchottkyAnoMaLy.μvalue","text":"μvalue(::Tuple{T, T})\nμvalue(::DonutVolcanoEnsemble, idx)\n\nReturn the value of μ from a given (μ, σ) Tuple.\n\n\n\n\n\n","category":"method"},{"location":"#SchottkyAnoMaLy.σvalue-Union{Tuple{Tuple{T, T}}, Tuple{T}} where T","page":"Home","title":"SchottkyAnoMaLy.σvalue","text":"σvalue(::Tuple{T, T})\nσvalue(::DonutVolcanoEnsemble, idx)\n\nReturn the value of σ from a given (μ, σ) Tuple.\n\n\n\n\n\n","category":"method"}]
